B.x4=new A.b3('{ "items" : [\n    {"type" : 1, "content" : "\u4e0a\u4e00\u7bc0\u8ab2\u88e1\u6559\u5230 JavaScript \u88e1\u82f1\u6587\u5b57\u5927\u5c0f\u5beb\u7684\u8b8a\u6578\uff0c\u4ee3\u8868\u4e0d\u540c\u7684\u8b8a\u6578\u3002\u4f8b\u5982 Year\u3001year \u662f\u4e0d\u540c\u7684\u8b8a\u6578\u3002JavaScript \u7684\u6307\u4ee4\u540d\u7a31\u4e5f\u9075\u5faa\u9019\u500b\u547d\u540d\u539f\u5247\u3002\u4e26\u4e14\u6709\u4e9b\u6307\u4ee4\u4ee5\u5c0f\u5beb\u958b\u982d\uff0c\u6709\u5beb\u6307\u4ee4\u4ee5\u5927\u5beb\u958b\u982d\uff0c\u672a\u4f86\u9084\u6703\u6559\u5c0e\u5275\u9020\u65b0\u7684\u6307\u4ee4\uff0c\u6240\u4ee5\u5728\u4f7f\u7528\u6307\u4ee4\u6642\u8981\u6ce8\u610f\u82f1\u6587\u5927\u5c0f\u5beb\u662f\u5426\u6b63\u78ba\uff0c\u624d\u80fd\u6b63\u78ba\u57f7\u884c\u7a0b\u5f0f\u3002"}]}',null)
